import './App.css';

const Header = () => {
  return (
    <>
      <div className='header-top'>
        <div className='container'>
          <h2>Header Top</h2>
        </div>
      </div>
      <div className='header-bottom'>
        <div className='container'>
          <h2>Header Bottom</h2>
        </div>
      </div>
    </>
  );
}

export default Header;
